import React, {Component} from 'react';
import {Link} from "@reach/router";

class Krtwalks extends Component {

    render() {
        const krtwalks = this.props.krtwalks.map(krtwalk =>
            <li key={krtwalk._id}>
                <Link to={`/krtwalk/${krtwalk._id}`}>{krtwalk.name}</Link>
            </li>
        );
        return (
            <>
                <h1>Krtwalks</h1>
                <ol>
                    {krtwalks}
                </ol>
            </>
        );
    }

}

export default Krtwalks;
